INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (1, '2020-08-20-12:31', 'Pending', 29, 'As your friend, it is my job to cheer you up with you need cheer. Or to offer you an ear and a shoulder when you need to talk. Which one do you want right now?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (2, '2020-08-25-04:31', 'Sent', 24, 'I miss you! How have you been spending your free time lately? I have been getting too acquainted with my couch! I hope you are having better luck than I!');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (3, '2021-10-15-02:31', 'Sent', 41, 'Even if the rain never stops I would either bring you an umbrella or dance in the rain with you! Which one suits you best at the moment?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (4, '2021-12-19-03:31', 'Pending', 72, 'It is natural to feel sad. It is ok to cry. It makes us human. On the other side of tears, there will be smiles and laughter. Do you feel like crying or laughing right now?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (5, '2020-10-25-09:31', 'Sent', 14, 'You are the sweetest person in the world. Have you been making time to eat, sleep, and care for yourself?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (6, '2021-11-13-02:30', 'Pending', 29, 'You make me want to be the best I can be. You changed my life for the better! What would make you feel happy right now?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (7, '2020-09-02-03:30', 'Sent', 82, 'What is your biggest challenge right now? In the face of challenge, you are incredible! I will face every challenge with you?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (8, '2020-12-28-10:31', 'Pending', 24, 'You are always glowing. It\'s probably because you have such a beautiful soul! What inspires you to be so creative and compassionate?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (9, '2020-06-21-04:30', 'Sent', 73, 'Loneliness doesn\'t stand a chance when you are around! It doesn\'t take any special day to remind me that I can rely on you! May your day be filled with sunshine! Is there anything exciting you want to talk about?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (10, '2020-08-02-09:31', 'Sent', 9, 'Better days are ahead, but even through the hard times, you make a difference to me. What kinds of things do you want to do when we can get together again?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (11, '2021-11-12-12:30', 'Pending', 31, 'Better days are ahead, but even through the hard times, you make a difference to me. What kinds of things do you want to do when we can get together again?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (12, '2020-12-18-09:31', 'Pending', 16, 'Standing by you is what I do because you always stand by me. The hard times can\'t stop us. Are there any burdens I can help you carry?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (13, '2021-11-12-09:30', 'Sent', 68, 'You are my hero! Your inner strength always impresses me. But, if you need me I am here! Is there anything I can do for you?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (14, '2021-04-29-01:30', 'Sent', 6, 'Loneliness doesn\'t stand a chance when you are around! It doesn\'t take any special day to remind me that I can rely on you! May your day be filled with sunshine! Is there anything exciting you want to talk about?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (15, '2020-09-28-11:30', 'Pending', 16, 'What is your biggest challenge right now? In the face of challenge, you are incredible! I will face every challenge with you?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (16, '2021-06-27-01:30', 'Sent', 68, 'When I feel lonely I think about you and it makes me feel better. Have you been feeling lonely lately?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (17, '2020-05-14-07:31', 'Sent', 80, 'Being alone reminds me how important you are to me! I miss you! How are you coping?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (18, '2021-07-30-10:31', 'Sent', 83, 'I am awarding you the most patient friend medal. No matter the interval in which we speak, I am always left feeling happier. Have you made any interesting discoveries today?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (19, '2020-02-27-10:29', 'Pending', 51, 'You are amazing! Having someone like you always be there for me makes me feel so blessed. Smile and know someone is thinking about you! Did you know you inspire me?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (20, '2020-05-19-11:31', 'Pending', 64, 'Did you know that I will always be there for you no matter what?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (21, '2020-11-09-04:30', 'Sent', 83, 'Whenever I need someone to talk to, you are always there for me! I appreciate that. Are you Ok? Is there anything you need to talk about? I am here for you too!');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (22, '2020-03-05-02:31', 'Pending', 92, 'What can I do to brighten your day? I was thinking about you, and admiring how you navigate the many challenges of life. Plus, you help me navigate mine! I want to return the kindness.');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (23, '2020-11-03-05:30', 'Pending', 89, 'Pandemics are the worst, but you are the best! I have always admired your ability to look on the bright side. There has never been a better time to remind you of that! What\'s on your post-pandemic to-do list?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (24, '2020-04-03-06:30', 'Sent', 62, 'I was just thinking about how much fun we have together. I am so relieved that I have you to keep me out of trouble! Where did you learn how to be such a great leader?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (25, '2021-02-15-05:28', 'Sent', 72, 'You are amazing! Having someone like you always be there for me makes me feel so blessed. Smile and know someone is thinking about you! Did you know you inspire me?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (26, '2021-09-16-10:30', 'Sent', 14, 'I was just thinking about how much fun we have together. I am so relieved that I have you to keep me out of trouble! Where did you learn how to be such a great leader?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (27, '2020-06-25-12:30', 'Pending', 2, 'When I don\'t hear from you I get withdrawal symptoms! I find myself curious about what mischief you have been into. Have you got any fun stories to share?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (28, '2021-02-01-05:28', 'Pending', 65, 'If you have a problem, I will get all CSI and find the solution! Are there any life mysteries I can help you work through?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (29, '2021-10-23-02:31', 'Pending', 79, 'You can overcome anything because you have a strong mind! I believe in you! What is on your mind! You can tell me anything!');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (30, '2020-11-18-10:30', 'Pending', 38, 'You are my hero! Your inner strength always impresses me. But, if you need me I am here! Is there anything I can do for you?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (31, '2021-06-12-12:30', 'Pending', 1, 'Reality can be good or bad. But no matter which it is I know I can rely on you. I want you to know you can rely on me! Is there anything you need?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (32, '2020-05-23-08:31', 'Sent', 21, 'We both deserve lasting happiness. I was just pondering emotions. Do you think happiness and well-being are the same things?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (33, '2021-10-26-01:31', 'Pending', 12, 'I miss you! How have you been spending your free time lately? I have been getting too acquainted with my couch! I hope you are having better luck than I!');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (34, '2021-09-17-04:30', 'Pending', 83, 'On the outside, it looks like we have a perfect friendship. On the inside, we do have a perfect friendship! Do you think we should start doing the high five regularly?');
INSERT INTO `Msg` (`Msg_id`, `Msg_time`, `Msg_status`, `Msg_sender`, `Msg_content`) VALUES (35, '2020-04-27-10:30', 'Pending', 13, 'Did you know that I will always be there for you no matter what?');
